import PropTypes from "prop-types";
import styled from "./Button.module.css"
function Button({text}) {
    return <button
        style={{
            backgroundColor : "tomato",
            color : "white",
            margin : 20,
            borderRadius : 10,
            border : 0
        }}
    >{text}</button>
}
Button.propTypes = {
    text : PropTypes.string.isRequired
}
export default Button
